import React from "react";
import styled from "styled-components";

const NavbarWrapper = styled.nav`
  width: 100%;
  height: 50px;
  background-color: #271815;
`;

const Navbar = () => (
    <NavbarWrapper>
        <span>Logo</span>
    </NavbarWrapper>
);

export default Navbar;
